package leetcode;
import java.util.HashMap;

public class Anagram {

	public static boolean isAnagram(String s, String t) {
		HashMap<Character, Integer> sHash = new HashMap<Character, Integer>();
		HashMap<Character, Integer> tHash = new HashMap<Character, Integer>();
		
		if(s.length() != t.length())
			return false;
		
		char c;
		for (int i = 0; i < s.length(); i++) {
			c = s.charAt(i);
			sHash.put(c, sHash.getOrDefault(c, 0)+1);
		}
		
		for (int i = 0; i < t.length(); i++) {
			c = t.charAt(i);
			tHash.put(c, tHash.getOrDefault(c, 0)+1);
		}
		/*for (char key : sHash.keySet()) {
			System.out.println(key+" "+sHash.get(key));
			System.out.println(key+" "+tHash.get(key));
		}*/
		
		for (char key : sHash.keySet()) {

			if (!tHash.containsKey(key))
				return false;
			if (!sHash.get(key).equals(tHash.get(key)))
				return false;
			tHash.remove(key);
		}
		
		if (!tHash.isEmpty())
			return false;
		
		return true;
	}


	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s = "";
		String t = "";
		System.out.print(isAnagram(s,t));
		
	}

}
